import logo from './logo.svg';
import './App.css';
import Header from './components/common/header';
import Card from './components/Card';

class App extends React.Component {
    constructor(props){
    super();
    }

    handleOnClick(){
        window.location = 'https://en.wikipedia.org/wiki/Lizard';
    }
    render(){
        return (
            <div>
              <Header name="Manabu"/>
              <div>
              <Card />
              </div>
            </div>
        )
    }
}
export default App;
